import './App.css';

function ThingsToDo(props) {

const theToDoList = () => {
        return(

            <ul>
                {props.toDoArray.map((item) => (<div class="toDoListItem"><li>{item}</li> <button type="submit">Clear</button></div>))}
            </ul>

            )        
    }



    return (
        <div>
        <p>a list of things to do will go here, with a button to delete when finished (or complete)?</p>
        <ul>{theToDoList()}</ul>
        </div>
    )
}







